# MAGIC %md
# MAGIC **Satporc es una nueva herramienta que nos permite construir el conjunto de datos de imágenes y máscaras necesarias para los modelos de segmentación de ML. Utiliza la imagen y un archivo vectorial poligonal que limita el objeto de interés.**
# MAGIC 
# MAGIC 
# MAGIC *¿Como funciona?*
# MAGIC 
# MAGIC Barre la imagen con una ventana de tamaño definido. Si encuentra un polígono dentro, crea una máscara binaria con 1 en el polígono y 0 en caso contrario. Luego mueve la ventana considerando el tamaño del paso y repite el proceso.
# MAGIC 
# MAGIC Este proceso se realiza para cada objeto de clase. Si hay más de una clase, todas las máscaras creadas en cada paso de la ventana se concatenan juntas; producir una imagen en la dimensión N de imágenes binarias.

