# MAGIC %md
# MAGIC El modelo es una red neuronal con una arquitectura **U-Net**. **Segmenta y clasifica objetos**.
# MAGIC 
# MAGIC U-Net es un tipo de modelo de CNN. Inicialmente fue creado para la segmentación de imágenes biomédicas, aunque también funciona para la segmentación de
# MAGIC imágenes. La U-Net se construye mediante muestreo descendente múltiple y
# MAGIC capas de muestreo ascendente, que están conectadas mediante la concatenación de capas.
# MAGIC De esta forma combina los nodos de activación de alta precisión con
# MAGIC nodos de la capa anterior con mejor resolución.

# COMMAND ----------

# MAGIC %md
# MAGIC ![unet2.png](data:image/png;base64,)

# COMMAND ----------

# MAGIC %md
# MAGIC 
# MAGIC 
# MAGIC 
# MAGIC * La entrada es un conjunto de imágenes y máscaras, donde cada una es una imagen binaria N-dimensional con muchas bandas como categorías a analizar
# MAGIC * La salida del modelo es un conjunto de imágenes N-dimensional en el que cada dimensión corresponde a la predicción de cada categoría; las bandas muestran un valor entre cero y uno para cada píxel.
# MAGIC 
# MAGIC 
# MAGIC Además, este modelo tiene la **ventaja** de permitir **agregar información adicional a una imagen como una capa GIS para mejorar el rendimiento del modelo**.
# MAGIC 
# MAGIC Durante el proceso de predicción, el modelo procesa todas las imágenes del área de interés. En este paso, la imagen puede tener diferentes tamaños en comparación con el conjunto de datos de entrenamiento a medida que el modelo aprende a los usuarios que definen los objetos, más allá de su tamaño.

